import Avatar from "@material-ui/core/Avatar";

function Post() {
  return (
    <div className = "post">
      <div className = "post_header">
        <h3>Username</h3>
        <Avatar
          className="post_avatar"
          src="../assets/manpal.jpg"
          alt="manpal"
        />
      </div>
      <img class="post_image" src={avatar} alt="avtar" />

      <h4 className="post_text">
        <strong> manpal </strong>is live now user capion
      </h4>
    </div>
  );
}

export default Post;
